/**
 *
 * HeaderModalNavContainer
 *
 */

import styled from 'styled-components';

const HeaderModalNavContainer = styled.div`
  display: flex;
  height: 3.8rem;
  margin-left: 5rem;
  padding-top: 0.6rem;
  color: #9ea7b8;
  font-size: 1.2rem;
  font-weight: 500;
  letter-spacing: 0.7px;
  text-transform: uppercase;

  > div:last-child {
    margin-left: 3rem;
  }
`;

export default HeaderModalNavContainer;
